import React from "react";
import { FaTripadvisor } from 'react-icons/fa';
import { FaFacebookF } from 'react-icons/fa';
import { FiInstagram } from 'react-icons/fi';
class Contact extends React.Component {
  render() {
    return (
      <section className="contact">
        <div className="contact_section contact_us">
          <h4>Contact Us</h4>
          <div className="short_border"></div>
          <span>
            Ask us anything! Weâ€™re here to answer any questions you have.
          </span>
        </div>
        <div className="contact_section  follow_us">
          <h4>Follow Us</h4>
          <div className="short_border"></div>
          <FaTripadvisor/>
          <FaFacebookF />
          <FiInstagram />
        </div>
        <div className="contact_section  sub_us">
          <h4>Subscribe for Updates & Offers</h4>
          <div className="short_border"></div>

          <form className="sub_form">
              <input type="text" placeholder="Enter you email here*"></input>
              <button type="button">Subscribe now!</button>
          </form>
        </div>
      </section>
    );
  }
}

export default Contact;
